class System10000051
{
    /**
     * @brief: 特殊数据内容段
     * @return string
     */
    public static function getSpecialCodeFragment()
    {
        LogUtils::info("System10000051::getSpecialCodeFragment ---> start");
        $isReportUser =  MasterManager::isReportUserInfo();
        LogUtils::info("System10000051::getSpecialCodeFragment ---> isReportUser" . $isReportUser);

        if (MasterManager::getAreaCode() == '204') {
            //只对入口260,237,259,265进行计费
            $areaCode = array(260,237,259,265,303,346,410);
            if(!in_array(MasterManager::getEnterPosition(), $areaCode) || preg_match('/[a-zA-Z]/',MasterManager::getAccountId())){
                $data = "TE1FUEcuTG9nLmVycm9yKCJHTyBHTyBHTyAhISEhISEhISIp";
                return $data;
            }
        }

        if (MasterManager::getAreaCode() == '209' && MasterManager::getEnterPosition() != 235) {
            $data = "TE1FUEcuTG9nLmVycm9yKCJHTyBHTyBHTyAhISEhISEhISIp";
            return $data;
        }

        if ($isReportUser == 1) {
            $data = "";
        } else {
            $data = "TE1FUEcuTG9nLmVycm9yKCJHTyBHTyBHTyAhISEhISEhISIp";
        }
        LogUtils::info("System10000051::getSpecialCodeFragment ---> data" . $data);
        return $data;
    }

